const BlogList = ({ blogs, deleteBlog }) => {
    return (
        <div className="blog-list">
            {
                blogs.map((blog) => (
                    <div className="blog-preview" key={blog.id}>
                        <h2>{blog.joke}</h2>
                        <h5>By {blog.author}</h5>
                        <button onClick={()=> deleteBlog(blog.id)} >Delete</button>
                    </div>
                ))
            }
        </div>
    );
}

export default BlogList;
